import React, { Component } from 'react';
import s from "./styleBlockVideo.css";

class BlocksVideo extends Component{
	constructor(props){
		super(props)
	}
	render(){
		return(
			<h1 className={s.test}>hi</h1>
		)
	}
}

export default BlocksVideo
